import React from 'react';
// import logo from './logo.svg';
// import './App.css';

import { Row, Col} from 'antd'

export default function Home(){
  return (
    <div className="App">
      {/* navbar */}
      <div>
        <Row>
          <Col xs={12} sm={12} >7</Col>
          <Col span={5}>5</Col>
        </Row>
      </div>
      <h1>ini home</h1>
    </div>
  )
}
